import React from "react";


class Weather extends React.Component{
    render(){
      return (
        <div>
        <p>Location: {this.prop.city}, {this.prop.country}</p>
        <p>Temperature: {this.prop.temperature}</p>
        <p>Humidity: {this.prop.humidity}</p>
        <p>Condition: {this.prop.description}</p>


        </div>
      );
    }
};

export default Weather;
